function as_s_d(p)
%
%  Deletes the global data that has been generated by 'as_s_i'.
%
%  Calling sequence:
%
%    as_s_d(p)
%
%  Input:
%
%    p         vector containing the ADI shift parameters.
%
%
%  LYAPACK 1.0 (Thilo Penzl, May 1999)

l = length(p);

for i = 1:l

  eval(lp_e( 'global LP_U',i ));

  eval(lp_e( 'clear global LP_U',i ));

end


